package com.dz.oa.controller;import com.dz.oa.service.ProjectService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Controller;import org.springframework.ui.ModelMap;import org.springframework.web.bind.annotation.RequestMapping;@Controller@RequestMapping({"/timesheet"})public class TimesheetController {	@Autowired	ProjectService projectService;	@RequestMapping("/new")	public String newTimesheet(ModelMap model) {		model.addAttribute("projList", projectService.getProjListForMap());		return "timesheet/timesheet";	}	@RequestMapping("/manage")	public String manageTimeSheet(ModelMap model) {		model.addAttribute("projList", projectService.getProjListForMap());		return "/timesheet/manage_time_sheet";	}}